var eventimage;

  if ( localStorage.getItem('eventimage')) {
    eventimage = localStorage.getItem('eventimage');
  }
  else {
    eventimage = '';
    localStorage.setItem('eventimage',eventimage);
  }

var eventimagecolor;

  if ( localStorage.getItem('eventimagecolor')) {
    eventimagecolor = localStorage.getItem('eventimagecolor');
  }
  else {
    eventimagecolor = '';
    localStorage.setItem('eventimagecolor',eventimagecolor);
  }


